import React from "react";

import "../../../style.css";
import Col from "react-bootstrap/Col";
import Row from "react-bootstrap/Row";
import vector3 from "../../../images/Vector 3.png";
import vector4 from "../../../images/Vector 4.png";
import iconWaiter from "../../../images/icon_waiter.png";
import iconChef from "../../../images/icon_chef.png";
import iconCleaner from "../../../images/icon_cleaner.png";
import axios from "axios";

import { useUserContext } from "../../../contexts/AuthContext";
import PreviousPageButton from "../../PreviousPageButton";
import { Button } from "react-bootstrap";
import { json, useNavigate } from "react-router-dom";
import { useEffect, useState } from "react";

export default function AllStaff() {
  return (
    <div>
      <Row>
        <Col className="d-flex justify-content-center col-m-25" sm={12}>
          <h2 className="col-m-25">All Staff </h2>
        </Col>
        <Col className="">
          <Row className="border d-flex justify-content-center mx-auto">
            <Col>
              <img src={iconWaiter} alt="logo" className="circular-image-3" />
            </Col>
            <Col className=" customButton6">
              <div className="d-flex flex-column justify-content-between h-100">
                <div>
                  <Row>
                    <h2>Merebe Abiguime</h2>
                    <p>(Chef)</p>
                  </Row>
                </div>
              </div>
            </Col>
          </Row>
        </Col>
      </Row>
    </div>
  );
}
